import MDEditor from '@uiw/react-md-editor';



export default function Markdown() {

  const file_name = 'markdown.md';
  
  const [value, setValue] = useState("");

  

  return (
    <div>
      <div className="container">
      <MDEditor
        value={value}
        onChange={setValue}
      />
      
      </div>
    </div>
  );
};
